import { Button } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'

const NotFoundPage = () => {
  return (
    <>
      <h1>Page Not Found</h1>
      <Link to="/login">Please Login to continue</Link>
    </>
  )
}

export default NotFoundPage
